import antfu, { imports, javascript, jsdoc, node, typescript } from '@antfu/eslint-config';

export default antfu(
    {
        type: 'app',
        stylistic: {
            indent: 4,
            quotes: 'single',
            semi: true,
            braceStyle: '1tbs',
        },
        markdown: false,
        typescript: true,
        ignores: [
            '.github/**',
            '.idea/**',
            '.vscode/**',
            '.wrangler/**',
            'dist/**',
            'node_modules/**',
        ],
    },
    imports,
    jsdoc,
    typescript,
    javascript,
    node,
    {
        rules: {
            'jsdoc/no-undefined-types': 'off',
            'jsdoc/require-returns-description': 'off',
            'jsdoc/require-property-description': 'off',
            'jsdoc/require-param-description': 'off',
            'node/prefer-global/process': 'off',
            'node/prefer-global/buffer': 'off',
            'eslint-comments/no-unlimited-disable': 'off',
            'padding-line-between-statements': 'off',
            'no-console': 'off',
            'style/brace-style': ['error', '1tbs', { allowSingleLine: true }],
        },
    },
);

import type { LibraryFormats, Plugin, UserConfig } from 'vite';
import * as path from 'node:path';
import { nodeResolve } from '@rollup/plugin-node-resolve';
import cleanup from 'rollup-plugin-cleanup';
import { nodeExternals } from 'rollup-plugin-node-externals';
import { defineConfig } from 'vite';
import checker from 'vite-plugin-checker';
import dts from 'vite-plugin-dts';

export interface Options {
    root: string;
    types?: boolean;
    formats?: LibraryFormats[];
    nodeExternals?: boolean;
    excludeMonoRepoPackages?: boolean;
}

export function createShareConfig(options: Options): UserConfig {
    const plugins: Plugin[] = [
        nodeResolve({
            browser: false,
            preferBuiltins: true,
        }),
        cleanup({
            comments: 'none',
            extensions: ['js', 'ts'],
        }),
        checker({
            typescript: true,
        }),
    ];
    if (options.types) {
        plugins.push(
            dts({
                rollupTypes: true,
            }),
        );
    }
    if (options.nodeExternals) {
        const exclude = new Array<RegExp>();
        if (options.excludeMonoRepoPackages) {
            exclude.push(/^@chatgpt-telegram-workers\/.+/);
        }
        plugins.push(
            nodeExternals({
                exclude,
            }),
        );
    }
    return defineConfig({
        plugins,
        build: {
            target: 'esnext',
            lib: {
                entry: path.resolve(options.root, 'src/index'),
                fileName: 'index',
                formats: options.formats || ['es'],
            },
            sourcemap: true,
            minify: false,
            outDir: path.resolve(options.root, 'dist'),
        },
    });
}
